import React from 'react';
import './Home.css';
import instagram from '../img/instagram.svg';
import linkedin from '../img/linkedin.svg';
import weixin from '../img/weixin.svg';
import github from '../img/github.svg';
import notion from '../img/notion.svg.png';


function Home() {
  return (
    <div> 
      <div className='image-container'>
        <img src="" alt="my-pic" />
      </div>
      <div className='paragraph-container'>
        <h1>你好！ <span></span></h1>
        <h1>我是张钰晟，或你也可以叫我 Anson~
        </h1>
        <span>前端资讯工程师</span>
        <p>毕业于台湾中正大学财务金融学系，第一份工作开始于普华永道上海，于大学便开始修习及自学程式设计，熟悉HTML/CSS(scss)/JavaScript，理解React框架及工作原理，并掌握Hooks，Router，状态管理工具redux(redux-toolkit)等。
        </p>
      </div>
      <div className='social-media'>
        <a href="https://www.instagram.com/anson_1998syat/" target='_blank' rel="noreferrer">
          <img src={instagram} alt="instagram-logo" />
        </a>
        <a href="https://www.linkedin.com/in/yucheng-zhang-22a416120/" target='_blank' rel="noreferrer">
          <img src={linkedin} alt="instagram-logo" />
        </a>
        <img src={weixin} alt="instagram-logo" />
        <a href="https://github.com/Anson-y-chang" target='_blank' rel="noreferrer">
          <img src={github} alt="instagram-logo" />
        </a>
        <a href="https://boiling-song-6da.notion.site/Coding-c804658730d04773984a05b3dccc27b8" target='_blank' rel="noreferrer">
          <img src={notion} alt="instagram-logo" />
        </a>
      </div>

    </div>
  );
}

export default Home;
